g(180000589,'Komunikazio-sistema batean, datuak abiadura txikian transmititzen dituen banda, <I>banda zabal<I>i kontrajarria. Abiaduraren muga ez dago oso argi: batzuetan, 64 kbps baino transmisio-abiadura txikiagoa duen bandari esaten zaio; bestetan, ordea, 1,544 Mbps baino abiadura txikiagoa duena adierazteko erabiltzen da. Gainera, teknologiaren aurrerapenarekin batera, balio horiek ere aldatu egiten dira. Edozelan ere, kontuan hartu behar dena da banda zabalak baino abiadura txikiagoa eskaintzen duela').
