g(180000640,'Abiadura handiko serieko busa, aldi berean datu-transferentzia bat baino gehiago egiteko eta osagaiak instalatu eta berehala erabiltzeko aukera ematen duena, instalazio prozedurarik jarraitu barik ("plug and play" sistema). IEEE 1394b bertsioak 800, 1.600 eta 3.200 Mbit/s-ko abiadurak izan ditzake. Konektore bakoitzak sei larako ditu, eta ordenagailura 63 gailu desberdin konektatzeko erabil daiteke. Disko gogorren unitateen, kamera digitalen eta beste bideo- zein audio-gailu batzuen interfaze digitala da').
g(180000641,'Ongarriak sortzeko prozesuan, fosfatoak azido sulfurikoarekin tratatzerakoan sortzen den azpiproduktu nagusia. Oinarrian, kaltzio sulfato hidratatua da. Metal astunak eta uranio- eta radio-kontzentrazio handiak ditu, eta ingurumenean kalte larriak eragin ditzake. Gainera, oso azidoa da.').
g(180000642,'Proteina osatzen duten aminoazido-kateek espazioan hartzen duten konfigurazio helikoidala, destrogiroa (erlojuen orratzen noranzkoan biribilkatua; gehienetan egitura hori izaten du) edo lebogiroa (erlojuen orratzen alderantzizko noranzkoan) izan daitekeena. Ondoz ondoko espiretako molekuletako <kar:marra_ertaina>CO<kar:marra_ertaina> eta <kar:marra_ertaina>NH<kar:marra_ertaina> taldeen artean hidrogeno-loturak eratzen dira, eta horrek sendotasun ematen dio egiturari. Espira bakoitzean 3,6 aminoazido-hondar daude, eta hondar bakoitzak 1,5 <kar:angstrom>-eko luzera du; beraz, espira bakoitza 5,4 <kar:angstrom> luze da').
g(180000643,'Azido azetiko ia purua (CH<->3<->COOH), % 1 ur baino gutxiago duena. Azkar kristalizatzen den likido higroskopiko erregarri eta garratza da. Disolbagarri ona da eta, besteak beste, olioa eta erretxinak disolbatzeko erabiltzen da').
