g(180000678,'Aireontzi baten hegaldiari haizeak nola eragiten dion adierazten duen bektore-diagrama. Haizearen bektorea, aireontziaren norabide-bektorea eta benetako ibilbide-bektorea biltzen ditu.').
g(180000679,'Aireontzien hegoen barruko erregai-tanga.').
g(180000680,'Proportzioan, kare eta magnesia baino silize- eta alumina-kantitate handiagoa duen zepa').
g(180000681,'Altzairu austenitikoak azkar hoztean agertzen den egitura, perlitaren eta martensitaren bitartekoa. Gogorra da, eta erresistentzia eta harikortasun handikoa').
g(180000682,'Fundiziorako erabiltzen den altzairua').
g(180000683,'Korronte elektrikoaren bidez berotutako labe batean ekoizten den altzairua').
g(180000684,'Mekanizazioa errazteko hainbat elementu gehitu zaizkion altzairua').
g(180000685,'Tenplaketaren eta tratamendu termiko egokiaren bidez gogortu den altzairua').
g(180000686,'Kristal-egiturako burdin atomoen artean bestelako elementurik ia ez duen altzairua. Batez ere, automobilgintzan erabiltzen da, enbutizio sakoneko prozesuetan').
g(180000687,'Altzairu baregeak baino oxigeno gutxiago eta baretuak baino gehiago duen altzairua. Oxigenoaren eta karbonoaren erreakziotik sortzen den karbono monoxidoak orekatu egiten du solidotzeak eragindako uzkurtzea').
g(180000688,'Karbonoa eta aleazio-elementuak nahita gehituak dituen burdin hauts konprimitua berotuz sortzen den altzairua').
g(180000689,'Disoluzio solido gainaseari bi zahartzapen-tratamendu aplikatzea, bata bestearen ondoren').
g(180000690,'Ezaugarri optimoak lortzeko behar dena baino luzaroagoan eta tenperatura altuagoan zahartzea').
g(180000691,'Hotzean egindako deformazio plastikoaren ondorioz gertatu den zahartzapena').
g(180000692,'Dagoeneko soldatuta dagoen baina bestelako tratamendurik jaso ez duen metala edo aleazioa').
g(180000693,'Metal berdinezko bi zati fusio bidez soldatzea material osagarririk erabili gabe').
g(180000694,'Gorputzean zentratutako kristal-egitura kubikoa (ferritikoa) duen altzairu herdoilgaitza').
g(180000695,'200-400 <kar:gradu>C tartean berotzean, altzairu batzuek izaten duten harikortasun-galera. Batez ere, tenperatura altuan landutako altzairuetan agertzen da; altzairu baretuetan, aldiz, ez').
g(180000696,'Altzairua edo burdina forjatua tenperatura altuan deformatzean materialaren aleek elkarrengandik bereizteko joera izatea').
g(180000697,'Material batek esfortzua kontzentratzen den gunean haustura hauskorra izateko duen aukera').
g(180000698,'Altzairu jakin batzuk 600-300 <kar:gradu>C tartean poliki hoztean edo, tenplatu ondoren, tarte horretara berotzean agertzen den hauskortasuna').
g(180000699,'Altzairu austenitikoa ferrita eta perlita bilakatzeko egiten den tratamendu termikoa. Materiala austenitizatu ondoren, hoztu eta tenperatura konstanteari eusten zaio austenita guztia eraldatu arte').
g(180000700,'Trakziopean dagoen material harikorrean gerta daitekeen haustura-mota. Hausturaren mutur batek sakonunea izaten du erdigunean, kopa baten antzeko formakoa').
g(180000701,'Metal edo aleazio batean, pitzadura aleen mugan zehar hedatzea').
g(180000702,'Pieza moldekatuek gogortze-fase bakoitzean izaten duten bolumen-murrizketa').
g(180000703,'Metalezko piezari material zeramikoz (aluminaz edo zirkonio oxidoz) osatutako geruza aplikatzea, produktua oso tenperatura altua jasateko gai izan dadin').
g(180000704,'Metal urtua zehar-ebaki egokia duen moldera isuri eta, hoztu ahala, etengabe erauztea, luzera-muga zehatzik ez duen pieza bat sortzeko').
g(180000705,'Metalezko piezari forma ematea, molde batean presiopean sartuta').
g(180000706,'Xehetasun handiko piezak, are gehiago lantzeko beharrik ez dutenak, sortzen dituen edozein moldekatze-prozesu').
g(180000707,'Egitura erdi-solidoa duen metalarekin egiten den galdaketa. Osaera jakineko metal-lingoteak urtu, eta, solidotzen hastean, indarrez irabiatzen dira egitura erdi-solidoa duen fluidotasun handiko metala lortzeko. Guztiz solidotu ondoren, berriz urtzen da forma emateko').
g(180000708,'Metal urtuari molde baten bidez forma ematea, presio atmosferiko baxuko ingurunean. Horri esker, aireak ez du materiala kontaminatzen eta metalean disolbatutako gasak erauz daitezke').
g(180000709,'Metal urtua hareaz egindako moldean isuriz forma ematean datzan teknika').
g(180000710,'Metala transformazio-tenperaturatik behera hoztea transformaziorik gertatu gabe').
g(180000711,'Kobre- eta merkurio-aleazioa. Batez ere, odontologian erabiltzen da.').
g(180000712,'Transformazio desegokiak eragozten dituen hozte-abiadura minimoa').
g(180000713,'Arku elektrikozko soldaduran, material urtuaren pisua edo luzera denbora-unitateko').
g(180000714,'Aldagai atmosferikoren bat, normalean tenperatura, altitudearen arabera jaisten den heina.').
g(180000715,'Ardatzak apur bat okertua dituzten bi arrabolez osatutako ijezkailua, Mannesman prozeduran erabiltzen dena').
g(180000716,'Altzairuzko plantxoiak edo lingoteak deformatu eta plantxoi mehe edo totxo bihurtzen dituen ijezkailua').
g(180000717,'Perlitaren barnean ez dagoen karbono askea grafito-forman duen burdinurtua').
g(180000718,'Karbonoaz gain beste aleazio-elementu batzuen kantitate handiak dituen altzairua').
g(180000719,'Oso karbono gutxi eta nikel ugari duen burdina-nikel aleazioa. Bero-tratamendu bereziaren bidez, egitura martensitikoa hartzen du eta, hala, erresistentzia handiko altzairua lortzen da').
g(180000720,'Metal-hautsa tenperatura altuan trinkotzea, gas-ganbera presurizatuan alde guztietatik presio konstantea aplikatuta').
g(180000721,'Tentsiopean dagoen altzairuan, deformazio plastikoa hasi ondoren neurtzen den esfortzu-baliorik txikiena').
g(180000722,'Tamaina mikroskopikoa duen ale, kristal edo partikula baten barnean gertatzen den segregazioa').
g(180000723,'Solidotutako metalean harrapatuta geratu den zepa').
g(180000724,'Ijezketan eta estrusioan, ekoitzitako piezak jasotzen dituen mahaia').
g(180000725,'Kristalen edo aleen zati bat, kristal beraren ondoko zatiaren orientazio ezberdina duena eta angelu txikiko mugen bidez bereizita dagoena').
g(180000726,'Soldadura-prozesuan, soldatzen den metala eta soldadura-beroak eragiten dion eremua barnean hartzen dituen azalera').
g(180000727,'Giro hodeitsua eta prezipitazio ugari sortzen dituen frontea edo fronte baten zatia').
g(180000728,'Airearen dentsitatea presioaren funtzio besterik ez deneko atmosfera-eredua; bertako azal isosteriko eta isopiknikoak azal isobarikoekiko paraleloak dira.').
g(180000729,'Oreka hidrostatikoan dagoen atmosferako tenperatura- eta presio-banaketa bertikala. Horren ondorioz, adiabatikoki lekualdatutako aire-partikulak inguruak duen tenperatura eta presio berdina izaten jarraituko du eta, hala, oreka-indarrek ezingo diote eragin').
g(180000730,'Eremu geografiko jakin bati dagokion eguraldiaren aurreikuspena').
g(180000731,'Eskualde batek hurrengo urteetan izango duen klimaren aurreikuspena').
g(180000732,'Uneko eguraldiaren ondorio dinamikoak kontuan hartu gabe, eskualdeko kliman soilik oinarritzen den eguraldi-iragarpena').
g(180000733,'Eremu jakin bateko (hiri, aireportu edo bestelako gune bateko) eguraldiaren aurreikuspena').
g(180000734,'Iragarpena aditzera ematen den egunetik hurrengo 3-10 egunetarako balio duen eguraldiaren aurreikuspena').
g(180000735,'Behatutako hasierako kondiziotan oinarrituta, hidrodinamikako oinarrizko ekuazioek emandako zenbakizko emaitzen bidez egiten den atmosferako perturbazioen aurreikuspena').
g(180000736,'Etorkizun dagoen eguraldia unekoa bera izango dela iragartzea. Beste iragartze-metodoen portaera konparatzeko oinarri gisa erabiltzen da maiz.').
g(180000737,'Ozeano Atlantikoko ipar-ekialdean kokatu ohi den antizikloi subtropikal erdi-iraunkorra').
g(180000738,'Lurrazal kontinentalaren gainean egon den eta, arrazoi horregatik, hezetasun gutxi duen airea').
g(180000739,'Polorantz nabarmen luzatzen den aire-masa beroa').
g(180000740,'5 mm-ko diametroa edo txikiagoa duen izotz-partikula; forma irregularra izan ohi du, eta gardena edo zeharrargia izaten da').
g(180000741,'Adiabatikoki hedatu den aire-masa hezea asetzen deneko presioa').
g(180000742,'Mendebaldeko korronte nagusitik alde egin eta horren hegoaldera kokatu ohi den depresio hotza').
g(180000743,'Ipar- eta hego-hemisferioetako antizikloi subtropikalen artean dagoen presio baxuko eremua').
g(180000744,'Bi hemisferioetako alisioek bat egiten duten eremu estua, ekuatoretik gertu').
g(180000745,'Eremu jakin batean, aireak 0 <kar:gradu>C-ko tenperatura konstantea duen atmosferako mailarik baxuena').
g(180000746,'Lurrean gertatzen diren mugimendu atmosferikoen deskribapen estatistiko osoa').
g(180000747,'Bi organoren kapilar-sistemak lotzen dituzten odol-hodien multzoa; esaterako, digestio-sistematik eta baretik gibelaren barnealdera doan eta hortik beheko kaba zainera bideratzen den zirkulazioa').
g(180000748,'Atmosfera oreka hidrostatikoan dagoela, hau da, azelerazio bertikalak baztergarriak direla onartzen duen hipotesia').
g(180000749,'Presio atmosferikoa lurralde baten gainean geografikoki nola banatzen den. Mapa batean irudikatzen da isobara izeneko lerroen bidez. Presioa altitudearen arabera aldatzen denez, irudikatzen den presioa zein altitudekoa den adierazten da.').
g(180000750,'Batez beste 50<kar:gradu> eta 70<kar:gradu> bitarteko latitudeetan zabaltzen diren behe-presioko eskualdeak').
g(180000751,'Karbono-atomo asimetriko baten lau loturetako talde ordezkatzaileen antolamendu espaziala.').
g(180000752,'Adenosina nukleosidoak azido fosforiko molekulekin era ditzakeen hiru konposatuetatik edozein. Alegia, adenosina monofosfatoa, adenosina difosfatoa nahiz adenosina trifosfatoa.').
g(180000753,'Azido nukleiko edo polinukleotido bateko baseek duten ordena zehatza').
g(180000754,'Organismo ezberdinetako geneetan aurkitu ohi den base-sekuentzia jakina, esaterako, TATA kutxa, transkripzio-faktoreen lotunea eta abar').
g(180000755,'Airearen bolumen espezifiko bera duten puntuak lotzen dituen atmosferako azala. Halako azala isopiknikoa da nahitaez.').
g(180000756,'Aldi errefraktario absolutuaren osteko denbora-tartea, zenbait milisegundokoa. Tarte horretan, nerbio-ehunen estimulazio-atalasea areagotu egiten da, eta ohikoa baino estimulazio handiagoa behar da ekintza potentzial bat has dadin.').
g(180000757,'Altitude handian (3,000 m inguruan) gertatzen diren egokitzapenen multzoa, hala nola arnas maiztasuna eta eritrozito-formula areagotzea; anoxia konpentsatzeko gertatzen da.').
g(180000758,'Seinale-mota; seinale horretan, itu-zelula seinale-zelulatik oso gertu dago, eta seinale-molekulak inguruko itu-zelulei baino ez dira eragiten.').
g(180000759,'Hestean odolera xurgatu eta energia bihur daitezkeen elikagaien multzoa. Elikagai batzuetan, mantenugaiak ez dira erabilgarriak, edo batzuk baino ezin daitezke erabili.').
g(180000760,'Gorputzeko zelulek nahiz organismo sinpleek zelulaz kanpoko likidoaren presio osmotikoari eusteko prozesua.').
g(180000761,'Organismo bizidun oro barne-ingurune urtsu batean bizi dela dioen funtsezko kontzeptua. Ingurune horrek inguratzen ditu ehun guztiak, eta mantenugaien eta hondakinen trukerako oinarrizko ingurunea da.').
g(180000762,'Zelulek bideratutako immunitatea; eragile garrantzitsuenak T linfozitoak dira').
g(180000763,'Biriken eremu guztiei eragiten dien enfisema; albeoloak dilatatu eta atrofiatu egiten dira, eta birikaren sare baskularra suntsitu').
g(180000764,'Artikuluetako kartilagoa biguntzea; errotulan gertatzen da maiz').
g(180000765,'Perikardioan odola pilatzea').
g(180000766,'Perikardioan likido serosoa pilatzea').
g(180000767,'Begiaren aurrealdeko ganberan gertatzen den zorne-pilaketa').
g(180000768,'Hipofisiak behar bezala ez funtzionatzeagatik hormona pituitarioa eta beste hainbat hormona gutxi jariatzea').
g(180000769,'Bihotzeko sortzetiko malformazioa; bi aurikulen arteko trenkadan zulo bat izatea. Akatsa konpondu ezean, arnas gutxiegitasuna eragiten du').
g(180000770,'Tiroidearen hantura-mota bat, zeinean nodulu bat baino gehiago sortzen baita').
g(180000771,'Pubertaroaren hasiera, pubiseko biloaren agerpenarekin eta genitalen tamaina handitzearekin abiarazten dena').
